import React from 'react';

class Form extends React.Component {
    render() {
      return (
        <form onSubmit={this.props.newItem}>
          <input type="text" name="product" placeholder="Введите продукт" />
          <button>Добавить продукт</button>
        </form>
      );
    }
}

export default Form;
